import React from 'react';

const Navbar = () => {
    return (
        <div>
            <nav>
                <a href="">HOME | </a>
                <a href="">POSTS | </a>
                <a href="">PROFILE | </a>
                <a href="">LOG OUT</a>
            </nav>
        </div>
    )
}

export default Navbar;
